// Extension {
//   Url: "http://example.org/fhir/extensions/foo",
//   ValueString: "bar",
// }
//
// becomes
//
// bson.M {
//   "@context": bson.M {
//     "foo": contextDefinition {
//       ID: "http://example.org/fhir/extensions/foo",
//       Type: "string",
//     },
//   },
//   "foo": "bar",
// }

